import React from 'react';
import './styles/auth-fields.css';

class AuthField extends React.Component {

	constructor(props) {
		super(props);
	}
	
	render() { 
		return <div className={`field-container ${this.props.className || ''}`}>
            <input id={this.props.name} type="text" placeholder={this.props.name} required autocomplete="off"/>
            <span>{this.props.name}</span>
        </div>
	}
}
export { AuthField };
